import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Report = () => {
  const [report, setReport] = useState([]);

  useEffect(() => {
    const fetchReport = async () => {
      const token = localStorage.getItem('token');
      if (!token) {
        console.error('No token found');
        return;
      }
      try {
        const res = await axios.get('http://localhost:5000/api/report', {
          headers: {
            'x-auth-token': token
          }
        });
        setReport(res.data);
      } catch (err) {
        console.error(err.response.data);
      }
    };

    fetchReport();
  }, []);

  return (
    <div>
      <h1>Report</h1>
      <table>
        <thead>
          <tr>
            <th>English</th>
            <th>Turkish</th>
            <th>Correct Count</th>
          </tr>
        </thead>
        <tbody>
          {report.map((word) => (
            <tr key={word.id}>
              <td>{word.english}</td>
              <td>{word.turkish}</td>
              <td>{word.correct_count}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Report;
